import React from 'react';

function Footer(){
    return(
        <footer class="bg-blue-400 text-white py-4">
  <div class="container mx-auto text-center">
    <p class="text-sm">&copy; 2025 Your Website Name. All Rights Reserved.</p>
    <p class="text-sm mt-2">
      Created with ❤️ by 
      <a href="https://yourwebsite.com" class="text-blue-400 hover:underline">
        Your Name
      </a>
    </p>
  </div>
</footer>

    )
}

export default Footer;
